import React from "react";

const Select = ({option}) => {
    return (
        <div>
            <hr className="m-2"/>
                <select>
                    <option value="value1">BY THE NAME</option>
                    <option value="value1">BY THE DESCRIPTION</option>
                </select>
        </div>
    )
}

export default Select
